package modchu.model.replacepoint;import modchu.model.replace.ModchuModel_ModelMultiModchuBase;public abstract class ModchuModel_ModelMultiReplacePoint extends ModchuModel_ModelMultiModchuBase {    /**     * コンストラクタは全て継承させること     */    public ModchuModel_ModelMultiReplacePoint() {    	this(0.0F);    }    /**     * コンストラクタは全て継承させること     */    public ModchuModel_ModelMultiReplacePoint(float psize) {    	this(psize, 0.0F);    }    /**     * コンストラクタは全て継承させること     */    public ModchuModel_ModelMultiReplacePoint(float psize, float pyoffset) {    	this(psize, pyoffset, 64, 32);    }    /**     * コンストラクタは全て継承させること     */    public ModchuModel_ModelMultiReplacePoint(float psize, float pyoffset, int par3, int par4) {    	super(psize, pyoffset, par3, par4);    }}